import React, { useState, useEffect } from "react";
import {
  Card,
  CardBody,
  Container,
  CardTitle,
  Badge,
  Row,
  Col,
  TabContent,
  TabPane,
  NavItem,
  NavLink,
  Label,
  Input,
  Form,
  FormGroup,
  Progress,
} from "reactstrap";

import Breadcrumbs from "../../../components/Common/Breadcrumb";

//i18n
import { withNamespaces } from "react-i18next";


import stateWrapper from "../../../containers/provider";

const DummyUsers = (props) => {



  return (
    <React.Fragment>
      <div className="page-content">
        <Container fluid>
          {/* Render Breadcrumb */}
          <Breadcrumbs
            title={props.t("My Users")}
            breadcrumbItem={props.t("DummyUsers")}
          />
          </Container>
        </div>
    </React.Fragment>
  );
};

export default withNamespaces()(stateWrapper(DummyUsers));
